def order_by_len(src_set):
  new_set = src_set
  def exchange(i, j):
    temp = new_set[i]
    new_set[i] = new_set[j]
    new_set[j] = temp
  
  for i in range(0, len(new_set)):
    for j in range(i + 1, len(new_set)):
      item_i = new_set[i]
      item_j = new_set[j]
      if len(item_i) > len(item_j):
        exchange(i, j)
  return new_set

